Review_pro:
Корпус из стекла и метала;
Идеальное приложение заметки и браузер Safari;
Падал несколько раз с высоты до метра на твердые поверхности - и ничего;
Приложение Команды предоставляет широкие возможности для автоматизации;
Заряда аккумулятора хватает на день активного использования;

- экран;
- хорошее качество фото, много режимов, фото в ночное время потрясающее.
- сенсор;
- дизайн;
- вес устройства;
- по сравнению с андроидом устройство не выпадает из рук;
- наличие eSIM;
- магазин приложений;
- гибкая настройка приложений;
- FaceID работает стабильно.

Review_contra:
- Автономность работы при включенных 2 симках;
- отсутствие возможности привязать карты Российских банков для оплаты приложений;
- установка приложений банков только в офисе банка через кабель;
- нет сканера отпечатков.
